import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import face from "./fb.png";
import twit from "./twitter.png";
import part from "./web.png";
function Footer(){
    const fb = {
        src: face,
        alt: "facebook"
    }
    const twitter = {
        src: twit,
        alt: "twitter"
    }
    const partners = {
        src: part,
        alt: "partners"
    }
    return(
        
            <footer>
                <div id="tekst">
                    <HorizontalnaLista prvi="ABOUT" drugi="TEAM" treci="CONTACT"/>
                </div>
                <div id="ikone">
                     <HorizontalnaLista
                        prvi={<Ikona url={fb.src} alt={fb.alt}/>} 
                        drugi={<Ikona url={twitter.src} alt={twitter.alt}/>}
                        treci={<Ikona url={fb.src} alt={fb.alt}/>}
                        />
                </div>
            </footer>
       
    );
}

export default Footer;
